using System;
using System.Drawing;
using System.IO;

namespace ResizeImageBase64_Demo
{
    public class Program
    {
        static void Main(string[] args)
        {
            Console.WriteLine("Hello, EV-Soft Consultores!");
            string base64Image = "";
            int maxWidth = 480;
            int maxHeight = 460;

            string resizedBase64Image = ResizeImageBase64(base64Image, maxWidth, maxHeight);
            string resizedBase64ImageFijo = ResizeImageBase64Fijo(base64Image);
            Console.WriteLine(resizedBase64Image);
            Console.WriteLine(resizedBase64ImageFijo);
        }

        static string ResizeImageBase64(string base64Image, int maxWidth, int maxHeight)
        {
            // Decodificar la imagen base64 en un arreglo de bytes
            byte[] imageBytes = Convert.FromBase64String(base64Image);

            using (MemoryStream ms = new MemoryStream(imageBytes))
            {
                using (Image originalImage = Image.FromStream(ms))
                {
                    // Calcular las dimensiones de la imagen redimensionada
                    int newWidth, newHeight;
                    if (originalImage.Width > originalImage.Height)
                    {
                        newWidth = maxWidth;
                        newHeight = (int)((float)originalImage.Height / originalImage.Width * maxWidth);
                    }
                    else
                    {
                        newWidth = (int)((float)originalImage.Width / originalImage.Height * maxHeight);
                        newHeight = maxHeight;
                    }

                    using (Bitmap resizedImage = new Bitmap(newWidth, newHeight))
                    {
                        using (Graphics graphics = Graphics.FromImage(resizedImage))
                        {
                            // Configurar la calidad de la imagen redimensionada
                            graphics.InterpolationMode = System.Drawing.Drawing2D.InterpolationMode.HighQualityBicubic;
                            graphics.SmoothingMode = System.Drawing.Drawing2D.SmoothingMode.HighQuality;
                            graphics.PixelOffsetMode = System.Drawing.Drawing2D.PixelOffsetMode.HighQuality;
                            graphics.CompositingQuality = System.Drawing.Drawing2D.CompositingQuality.HighQuality;

                            // Redimensionar la imagen
                            graphics.DrawImage(originalImage, 0, 0, newWidth, newHeight);

                            // Guardar la imagen redimensionada en un nuevo MemoryStream
                            using (MemoryStream resizedMs = new MemoryStream())
                            {
                                resizedImage.Save(resizedMs, originalImage.RawFormat);

                                // Convertir el MemoryStream a un arreglo de bytes
                                byte[] resizedBytes = resizedMs.ToArray();

                                // Convertir el arreglo de bytes a una cadena base64
                                string resizedBase64 = Convert.ToBase64String(resizedBytes);

                                return resizedBase64;
                            }
                        }
                    }
                }
            }
        }

        static string ResizeImageBase64Fijo(string base64Image)
        {
            // Decodificar la imagen base64 en un arreglo de bytes
            byte[] imageBytes = Convert.FromBase64String(base64Image);

            using (MemoryStream ms = new MemoryStream(imageBytes))
            {
                using (Image originalImage = Image.FromStream(ms))
                {
                    using (Bitmap resizedImage = new Bitmap(512, 512))
                    {
                        using (Graphics graphics = Graphics.FromImage(resizedImage))
                        {
                            // Configurar la calidad de la imagen redimensionada
                            graphics.InterpolationMode = System.Drawing.Drawing2D.InterpolationMode.HighQualityBicubic;
                            graphics.SmoothingMode = System.Drawing.Drawing2D.SmoothingMode.HighQuality;
                            graphics.PixelOffsetMode = System.Drawing.Drawing2D.PixelOffsetMode.HighQuality;
                            graphics.CompositingQuality = System.Drawing.Drawing2D.CompositingQuality.HighQuality;

                            // Redimensionar la imagen
                            graphics.DrawImage(originalImage, 0, 0, 512, 512);

                            // Guardar la imagen redimensionada en un nuevo MemoryStream
                            using (MemoryStream resizedMs = new MemoryStream())
                            {
                                resizedImage.Save(resizedMs, originalImage.RawFormat);

                                // Convertir el MemoryStream a un arreglo de bytes
                                byte[] resizedBytes = resizedMs.ToArray();

                                // Convertir el arreglo de bytes a una cadena base64
                                string resizedBase64 = Convert.ToBase64String(resizedBytes);

                                return resizedBase64;
                            }
                        }
                    }
                }
            }
        }
    }
}